-- 导出  过程 spring-activiti.getOrganizationChildIds 结构
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `getOrganizationChildIds`(
	IN `paramId` INT(11)
,
	OUT `resultIds` TEXT







)
BEGIN 
	DECLARE ids CHAR(255); 
	SET ids = cast(paramId AS CHAR);

	WHILE ids is not null DO 
		SET resultIds = IF(resultIds != "", concat(resultIds,',',ids), concat(ids));
		SELECT group_concat(id) INTO ids FROM organization where FIND_IN_SET(pid, ids) > 0;
	END WHILE;
END//
DELIMITER ;

-- 导出  过程 spring-activiti.getResourceChildIds 结构
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `getResourceChildIds`(
	IN `paramId` INT(11)
,
	OUT `resultIds` TEXT


)
BEGIN 
	DECLARE ids CHAR(255); 
	SET ids = cast(paramId AS CHAR);

	WHILE ids is not null DO 
		SET resultIds = IF(resultIds != "", concat(resultIds,',',ids), concat(ids));
		SELECT group_concat(id) INTO ids FROM resource where FIND_IN_SET(pid, ids) > 0; 
	END WHILE;
END//
DELIMITER ;

